public long readRawVarint64() throws IOException {
	int shift = 0;
	long result = 0;
	while (true) {
		if (bufferPos >= bufferSize) {
			if (bufferPos >= bufferSizeAfterLimit) {
				throw new IOException("CodedInputStream reached limit");
			}
			refillBuffer(true);
		}
		int b = buffer[bufferPos++];
		result |= (long) (b & 0x7F) << shift;
		if ((b & 0x80) == 0) {
			return result;
		}
		shift += 7;
		if (shift >= 64) {
			throw new IOException("CodedInputStream reached limit");
		}
	}
}

