	if(start.isVisitedWrtTo(stop)) return new OuterFaceCirculator(start,null);
	Node v=start;
	Node prev=null;
	while(true){
		if(DEBUG) System.out.println("selectOnOuterFace: "+v);
		if(predicate.test(v)){
			if(DEBUG) System.out.println("selectOnOuterFace: "+v+" is selected");
