	if(tour.isEmpty()){
		return null;
	}
	if(tour.size()==1){
		return new GraphPath<V,E>(graph,tour.iterator().next());
	}
	GraphPath<V,E> path=new GraphPath<V,E>(graph);
	Iterator<E> it=tour.iterator();
	E edge=it.next();
	path.add(edge);
	while(it.hasNext()){
		edge=it.next();
		path.add(edge);
	}
	return path;
}

