@Override public boolean hasNext(){
	if (current == null) {
		return false;
	}
	if (next!= null) {
		return true;
	}
	if (bucketList.isEmpty()) {
		return false;
	}
	if (current == null) {
		current = bucketList.poll();
		if (current == null) {
			return false;
		}
		head = current;
		next = current.next;
		prev = current.prev;
	}
	if (next == null) {
		next = head;
		prev = head;
	}
	if (next == current) {
		return false;
	}
	if (next.containsBucketWith(current)) {
		next = next.next;
		prev = prev.prev;
	}
	return true;
}

