private boolean unlink(ListNodeImpl<E> node){
	if(node == null){
		return false;
	}
	if(node.getPrev() == null){
		head = node.getNext();
	}else{
		node.getPrev().setNext(node.getNext());
	}
	if(node.getNext() == null){
		last = node.getPrev();
	}else{
		node.getNext().setPrev(node.getPrev());
	}
	node.setNext(null);
	node.setPrev(null);
	size--;
	expectedModCount++;
	return true;
}

