public static boolean substringMatch(CharSequence str,int index,CharSequence substring){
	if (str == null || substring == null) {
		return false;
	}
	if (index < 0 || index > str.length() - substring.length()) {
		return false;
	}
	if (str instanceof String && substring instanceof String) {
		return ((String) str).startsWith((String) substring, index);
	}
	for (int j = substring.length() - 1; j >= 0; j--) {
		if (str.charAt(index++)!= substring.charAt(j)) {
			return false;
		}
	}
	return true;
}

